import React from 'react';
import './Banner.css';
import logo from "../logo.png"

function Banner(){
    return(
        <div className="banner">
            <img src={logo} alt="Banner" className="banner-image"/>
            <div className="banner-content">
                <h1>Welcome to Speak Your Mind</h1>
            </div>
        </div>
    );
}

export default Banner;
